import React from 'react';
import "./nav.css"



function Nav({ currentPage, handlePageChange }) {
  return (
    <nav className='navItems navbar navbar-expand-lg navbar-light'> 
    <div class="container-fluid">
    <a class="navbar-brand" href="#">Chris</a>
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarSupportedContent"></div>
    <ul className='navbar-nav me-auto mb-2 mb-lg-0'>
      
      <li className='nav-item'>
        <a className="nav-link active" href="#home" onClick={() => handlePageChange('Home')}
          className={currentPage === 'Home' ? 'nav-link active' : 'nav-link'}>Home</a>
      </li>

      <li>
        <a href="#about" onClick={() => handlePageChange('About')}
          className={currentPage === 'About' ? 'nav-link active' : 'nav-link'}>About</a>
      </li>

      <li>
        <a href="#portfolio" onClick={() => handlePageChange('Portfolio')}
          className={currentPage === 'Experience' ? 'nav-link active' : 'nav-link'}>Portfolio</a>
      </li>

      <li>
        <a href="#contact" onClick={() => handlePageChange('Contact')}
          className={currentPage === 'Contact' ? 'nav-link active' : 'nav-link'}>Contact</a>
      </li>
      
    </ul>
      </div>
    </nav>
  );
}

export default Nav;
